if mibBuilder.loadTexts: cermResOwnerTable.setDescription("This table contains information about each resource owner in the system. Each resource owner maintains a list of resource users and performs the following: a) Accounting and Thresholding Accounting and thresholding involves accounting of resources allocated to each resource user and using threshold limits for notifying resource user(s) and resource usage monitor(s) about violations. Accounting is done by each resource owner. The ERM framework allows user to configure thresholding values for each resource owner. When resource utilization of a resource owner exceeds an applied threshold value, the resource owner will send notification to relevant resource user(s). b) Notifications Sent and Actions Taken In case of system global thresholding, whenever total resource utilization of a resource owner exceeds an applied rising threshold value, the resource owner will send an 'up' notification to the ERM framework. Whenever total resource utilization of the same resource owner falls below the corresponding falling threshold value (after crossing the rising threshold value), the resource owner will sent a 'down' notification to the ERM framework. On receiving the 'up' notification, resource user(s) is(are) expected to take appropriate action by freeing the resource or limiting the resource consumption. The resource owner may restrain from allocating resource to the resource user(s) in case of the resource user(s) not taking any action.")
