if mibBuilder.loadTexts: cermResOwnerSubTypeThresholdEntry.setDescription("An entry containing an applied global threshold configuration details for a resource owner sub-type. This entry includes threshold severity level, rising threshold value, rising interval time, falling threshold value and falling interval time for the threshold configuration. One or more entries will be included in this table when a global resource policy is applied. If the system has internally applied any threshold values, those threshold configurations will also be present in this table. For example, if the applied global resource policy has 'major' and 'critical' severity threshold configurations for 'processor' memory sub-type of the 'memory' resource owner, then two entries will be included in this table for the 'processor' memory sub-type. All threshold configuration entries included via applying the global resource policy, will be removed when the applied global resource policy is unapplied/unconfigured. Note: Global resource policy is applied by setting the scalar object cermScalarsGlobalPolicyName to an existing global resource policy in the cermConfigPolicyTable. Global resource policy is unapplied by setting the cermScalarsGlobalPolicyName to zero-length string. Apart from threshold configurations in the applied global resource policy (those are configured and applied by the user), the system may have some internally applied global threshold configurations for some resource owners for which the user is not allowed to configure thresholding. The entPhysicalIndex represents the physical entity to which the resource owner belongs. Only 'module' class physical entities which run operating system with the ERM framework, are applicable here.")
