if mibBuilder.loadTexts: cermResOwnerSubTypeRisingThresh.setDescription("This object indicates the applied global rising threshold value for the resource owner sub-type. When total resource utilization of the resource owner sub-type exceeds the rising threshold value set for it, the resource owner sends an 'up' notification to the ERM framework. If the ERM framework did not receive any 'down' notification from the same resource owner sub-type till the rising interval time (represented by cermResOwnerSubTypeRisingInterval) is elapsed, the 'up' notification will be sent to all resource users which consume resources from the resource owner. The order of sending the 'up' notification will be based on priority of those resource users. Lowest priority resource user will get the 'up' notification first. Upon receiving the 'up' notification, the resource users can take appropriate action (for example, limiting consumption of the concerned resource).")
cermResOwnerSubTypeRisingInterval = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 9, 510, 1, 2, 3, 1, 3), CermDampenInterval()).setUnits('seconds').setMaxAccess("readonly")
