if mibBuilder.loadTexts: cermResOwnerSubTypeFallingThresh.setDescription("This object indicates the applied global falling threshold value for the resource owner sub-type. The global falling threshold value will be applicable only after an 'up' notification is sent by the resource owner. When resource utilization of the resource owner sub-type falls below the applied global falling threshold value (after crossing the corresponding global rising threshold value), the resource owner sub-type sends a 'down' notification to the ERM framework. If the ERM framework did not receive any 'up' notification from the same resource owner sub-type till the falling interval time (represented by the object cermResOwnerSubTypeFallingInterval) is elapsed, the 'down' notification will be sent to all resource users which consume resources from the concerned resource owner sub-type. The order of sending the 'down' notification will be based on priority of those resource users. Highest priority resource user will get the 'down' notification first. Upon receiving the 'down' notification, the resource users can start consuming the concerned resource as usual. If the global rising threshold value is configured but the global falling threshold value is not configured in the applied threshold configuration for the resource owner sub-type, then default value would be taken. The default value is specific to the resource owner sub-type and may depend on the rising threshold value.")
